import React from 'react';
import Check from "./Components/Check/check";
function App() {
  return (
    <BrowserRouter>
     <Menu />
    <Routes>
      <Route path="Check" element={<Check />}/>
      </Routes>
      <Footer />
  </BrowserRouter>

  );
}
export default  App;
